import React from "react";

const Paginate = ({ countriesPerPage, countries, paginated }) => {
  const pageNumber = [];
  for (let i = 0; i < Math.ceil(countries / countriesPerPage); i++) {
    pageNumber.push(i);
  }

  return (
    <div>
      <ul>
        {pageNumber?.map((number) => (
          <li key={number}>
            <Link/>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Paginate;
